import { StyleSheet, StatusBar, View } from "react-native";
import React from "react";
import Rotas from "./components/Rotas";

export default function App() {
  return (
    <View>
      <Rotas />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingTop: StatusBar.currentHeight,
  },
});
